import React from 'react';
import getGenres from '../services/fakeGenreService';

const categories = () =>
{
    const allGenres = getGenres();

    return ( 
        <React.Fragment>
           <div class="list-group">
                {allGenres.map(genre =>(
                    <a key={genre._id} href="/" class="list-group-item list-group-item-action active">{genre}</a>
                ))}
            </div>
        </React.Fragment>
    );
}

export default categories;
